--
-- Table structure for table `vote_count`
--

DROP TABLE IF EXISTS `vote_count`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `vote_count` (
  `CandidateName` varchar(50) NOT NULL,
  `Year` int NOT NULL,
  `StateName` varchar(50) NOT NULL,
  `CountyName` varchar(50) NOT NULL,
  `Count` int NOT NULL,
  PRIMARY KEY (`CandidateName`,`Year`,`StateName`,`CountyName`),
  KEY `StateName` (`StateName`,`CountyName`),
  CONSTRAINT `vote_count_ibfk_1` FOREIGN KEY (`CandidateName`, `Year`) REFERENCES `candidate` (`CandidateName`, `Year`),
  CONSTRAINT `vote_count_ibfk_2` FOREIGN KEY (`StateName`, `CountyName`) REFERENCES `county` (`StateName`, `CountyName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

